import { Component } from 'react';

// const BASE_URL = '';

class API extends Component {
	getData() {
		let url = 'http://api.scb.se/OV0104/v1/doris/sv/ssd/';
		return fetch(url).then(this.processResponse);
	}

	getRandomItem() {
		let url = 'http://api.scb.se/OV0104/v1/doris/sv/ssd/';
		return randomWalk(url);
	}

	randomWalk(url) {
		return fetch(url)
			.then(this.processResponse)
			.then(res =>
				res.isArray() ? randomWalk(url + res[Math.floor(Math.random() * res.length)].id) : res.title
			);
	}

	processResponse(response) {
		if (response.ok) {
			return response.json();
		}
		throw response;
	}
}
export default API;
